  namespace: MLEM.Misc
  summary: >-
    Represents an object that can hold generic key-value based data.

    A lot of MLEM components extend this class to allow for users to add additional data to them easily.

    This <xref href="MLEM.Misc.IGenericDataHolder" data-throw-if-not-resolved="false"></xref> implemention uses an underlying <xref href="System.Collections.Generic.Dictionary%602" data-throw-if-not-resolved="false"></xref> that only keeps track of non-default values.
